import React, {Component} from 'react';
import { Header} from '../../components'
import { PokemonList} from '../../containers'

class Home extends Component {
    render(){
        return (
            <>
                <Header 
                    rightAction= '/mypokemon'
                />
                <PokemonList/>
            </>
        )
    }

}

export default Home;
